import React, {Dispatch} from "react";
import Logo from '../assets/images/top_logo.png';
import BaseButtons from "./commons/baseButtos";

interface Props {
    type?: string;
    setType : React.SetStateAction<Dispatch<string>>
}
export default function Header({type, setType} : Props) {
    return (
        <div className='h-[240px] w-full bg_base ml-[80px] pl-8 flex flex-col'>
            <div className='head_div pt-2'>
                <img src={Logo} alt={'Logo'} width={200}/>
            </div>
            <div className='head_button_group flex head_div'>
                <div className='w-full'>
                    <BaseButtons text={'마이체크업'} className='header_button basis-1/2'/>
                    <BaseButtons text={'벨류맵'} className='header_button'/>
                </div>
            </div>
            <div className='head_div pt-2 flex items-center text-white'>
                <p>{type === '01' ? "마이체크업" : "벨류맵"}</p>
            </div>
        </div>
    )
}
